import styled from 'styled-components'

export const TileContainer = styled.div`
    width: 960px;
    min-height: 100%;
    display: flex;
    align-content: flex-start;
    flex-wrap: wrap;
    overflow
`;

export const Button = styled.button`
    display: block;
    width: 40px;
    height: 40px;
    position: fixed;
    top: 80%;
    left: 90%;
`;
